“La Ley contra la violencia vicaria, es una realidad en el Estado de Chiapas”.

El día de ayer tuve el honor de acompañar a mis amigas del Frente Estatal contra la Violencia Vicaria, donde fui testigo de la lectura, discusión y votación del dictamen que presentan las comisiones unidas de gobernación y puntos constitucionales de justicia, y de atención a la mujer y a la niñez, relativo a la iniciativa de decreto por el que se reforman y adicionan diversas disposiciones de la ley de desarrollo constitucional para la igualdad de género y acceso a una vida libre de violencia para las mujeres; del código civil y del código penal para el estado de Chiapas, en materia de violencia a través de interpósita persona.

La violencia vicaria se define como los actos u omisiones que tienen por objeto dañar a las madres o padres de familia, a través de sus hijas o hijos, familiares o personas allegadas. 

Esta forma de violencia puede manifestarse en situaciones donde existe o existió una relación de matrimonio o concubinato, en casos en los que la víctima mantiene o ha mantenido una relación de hecho con la persona agresora.

La ley vicaria, ya es ley en el estado de Chiapas, aprobada el día miércoles 28 de febrero de 2024, por unanimidad con 29 votos a favor y 0 en contra, por diputadas y diputados del Honorable Congreso del Estado de Chiapas.

